function deploy()
{
  if(!setUpCheck(false))
  {
    return;
  }
  txTemp = document.createElement("li");
  var bcr = bc;
  toDeploy = new web3.eth.Contract(abi,{from:account, data:bcr});
  dSMN = $("#dataScientistModelNameInput").val();
  sP =  (BigInt($("#dataScientistStakePromiseInput").val()) * (BigInt("1000000000000000000")));
  cE =  (BigInt($("#costETHInput").val())* BigInt("1000000000000000000"));
  toDeploy.deploy({data:bcr,arguments:[dSMN,cE,sP]}).send({from:account}).then(

      function(newContractInstance)
      {

          txTemp = document.createElement("li");
          txTemp.className = "list-group-item";
          txTemp.innerHTML = '<a target="_blank" href = "https://kovan.etherscan.io/address/' + newContractInstance.options.address+'">'+ "Deploy." +" " + String(new Date()) + "</a>";
          document.getElementById("transactionLog").appendChild(txTemp);
          $("#newInfo").val(newContractInstance.options.address);
          retreiveContract();
      }
  );
}
